import React, { useState, useEffect } from "react";

const Useffect = () => {
    const [count, setCount] = useState(0);

    useEffect(() => {
      setTimeout(() => {
        setCount((count) => count + 1);
      }, 1000);
    });
  
    return (
    <>
    <h1>useEffect</h1>
    <h2>Rendering time in secs using useeffect concept {count} times!</h2>;
    </>
    )
}
export default Useffect;
